import React from 'react';

import { NavLink } from 'react-router-dom';
import '../../css/navigation.css';

function openNav() {
  document.getElementById("navbar").style.width = "150.5px";
}

function closeNav() {
  document.getElementById("navbar").style.width = "0";
}

const Navigation = () => {
  return (
    <div id="navbar" className="navbar">
      <NavLink to="/" className="button noselect navbarButton">Home</NavLink>
      <NavLink to="/about" className="button noselect navbarButton">About</NavLink>
      <NavLink to="/contact" className="button noselect navbarButton">Contact</NavLink>
      <NavLink to="/designer" className="button noselect navbarButton">Designer</NavLink>
      <NavLink to="/play" className="button noselect navbarButton">Play Online</NavLink>
      <a onclick={closeNav} className="navbarClose">&#9776;</a>
    </div>
  );
}

export default Navigation;
